				}
				urlvar[variable] = valeur;
				urlvarnum[i] = valeur;
			}
			html = html_by_id[urlvar['contextid']];
			if (html !== null && html !== undefined )
			{
				document.write("<meta http-equiv=\"Refresh\" content=\"1;url=default.html?" + html + "\">");
			}
			else
			{
				document.write("<meta http-equiv=\"Refresh\" content=\"1;url=default.html\">");
			}
		}
		else
		{
			document.write("<meta http-equiv=\"Refresh\" content=\"1;url=default.html\">");
			document.write("<meta http-equiv=\"Refresh\" content=\"1;url=../default.html\">");
		}
	</script>
